/** @odoo-module */

import { registry } from "@web/core/registry";
import { listView } from "@web/views/list/list_view";
import { ListController } from "@web/views/list/list_controller";
import { useService } from "@web/core/utils/hooks";

class IctReportListController extends ListController {
    setup() {
        super.setup();
        this.orm = useService("orm");
    }

    showDatePicker() {
        const datePickerModal = document.createElement('div');
        datePickerModal.className = 'date-picker-modal';


        datePickerModal.innerHTML = `
            <div class="date-picker-content">
                <span class="close-button">&times;</span>
                <h2>Date Filter</h2>
                <div>
                <span><input type="date" id="startDateAD"></span>
                <span>-</span>
                <span><input type="date" id="endDateAD"></span>
                </div>
                <div>
                <span><input type="text" id="startDateBS" placeholder="BS Date"></span>
                <span>-</span>
                <span><input type="text" id="endDateBS" placeholder="BS Date"></span>
                </div>
                <button class="btn btn-primary o_list_button_add button-gap-top" id="generateButton">Generate Report</button>
                <button class="btn btn-primary o_list_button_add button-gap-top" id="generateSheetButton">Excel Report</button>
            </div>
        `;
        document.body.appendChild(datePickerModal);
        var startD = document.getElementById("startDateBS");
        var endD = document.getElementById("endDateBS");
        startD.nepaliDatePicker({
            onChange: function(selectedDate) {
                if (typeof selectedDate === 'object' && selectedDate.hasOwnProperty('ad')) {
                    const selectedADDate = selectedDate.ad;
                    document.getElementById("startDateAD").value = selectedADDate;
                } else {
                    console.error("Invalid selected date format:", selectedDate);
                }
            }
        });
        endD.nepaliDatePicker({
            onChange: function(selectedDate) {
                if (typeof selectedDate === 'object' && selectedDate.hasOwnProperty('ad')) {
                    const selectedADDate = selectedDate.ad;
                    document.getElementById("endDateAD").value = selectedADDate;
                } else {
                    console.error("Invalid selected date format:", selectedDate);
                }
            }
        });

        function adjustBoxPosition(event) {
            var box = document.getElementById('ndp-nepali-box');
            var target = event.target;
            if (target.tagName.toLowerCase() === 'input') {
                var rect = target.getBoundingClientRect();
                var newTop = rect.bottom;
                var newLeft = rect.left-60;
                box.style.top = newTop + 'px';
                box.style.left = newLeft + 'px';
            }
        }
        startD.addEventListener('click', adjustBoxPosition);
        endD.addEventListener('click', adjustBoxPosition);
        const startDateAD = document.getElementById("startDateAD");
        const endDateAD = document.getElementById("endDateAD");
        startDateAD.addEventListener('change', onStartDateADChange);
        endDateAD.addEventListener('change', onEndDateADChange);
        function onStartDateADChange(event) {
            const startDateADValue = event.target.value;
            const startDateBSValue = NepaliFunctions.AD2BS(startDateADValue);
            document.getElementById("startDateBS").value = startDateBSValue;
        }
        function onEndDateADChange(event) {
            const endDateADValue = event.target.value;
            const endDateBSValue = NepaliFunctions.AD2BS(endDateADValue);
            document.getElementById("endDateBS").value = endDateBSValue;
        }
                
        const startDatePicker = datePickerModal.querySelector('#startDateAD');
        const endDatePicker = datePickerModal.querySelector('#endDateAD');
        const generateButton = datePickerModal.querySelector('#generateButton');
        const generateSheetButton = datePickerModal.querySelector('#generateSheetButton');
    
        const closeButton = datePickerModal.querySelector('.close-button');
        closeButton.addEventListener('click', () => {
            datePickerModal.remove();
        });
    
        // Event listener for the generate button
        generateButton.addEventListener('click', () => {
            const startDate = startDatePicker.value;
            const endDate = endDatePicker.value;
            this.generateReport(startDate, endDate);
            datePickerModal.remove();
        });
        generateSheetButton.addEventListener('click', () => {
            const startDate = startDatePicker.value;
            const endDate = endDatePicker.value;
            this.generateSheet(startDate, endDate);
            datePickerModal.remove();
        });
    }
    

    async generateReport(dateFrom, dateTo) {
        try {
            const reportData = await this.orm.call("inter.company.transfer.line.ept", "generate_report", [dateFrom, dateTo]);
            console.log(reportData);
            this.createPdfReport(reportData);
        } catch (error) {
            console.error("Error generating report:", error);
        }
    }
    async generateSheet(dateFrom, dateTo) {
        try {
            const reportData = await this.orm.call("inter.company.transfer.line.ept", "generate_report", [dateFrom, dateTo]);
            this.createExcelSheet(reportData);
        } catch (error) {
            console.error("Error generating sheet:", error);
        }
    }
    
    createExcelSheet(reportData) {
        const parsedData = JSON.parse(reportData);
    
        const columns = [
            { header: "क्र.सं.", dataKey: 'serial' },
            { header: "कृषक संकेत", dataKey: 'farmerid'},
            { header: "कृषकको नाम", dataKey: 'name'},
            { header: "ठेगाना", dataKey: 'farmerward'},
            { header: "कारोवार संख्या", dataKey: 'transaction_count'},
            { header: "कृषि उपजको उप-योगफल", dataKey: 'sub_total'},
            { header: "ढुवानी दस्तुर", dataKey: 'delivery_charge'},
            { header: "सेवा शुल्क", dataKey: 'servce_charge'},
            { header: "जम्मा", dataKey: 'total'},
            { header: "अनुदान", dataKey: 'subsidy'},
        ];
        let serial=0;
    
        const worksheetData = [
            columns.map(col => col.header), // headers
            ...parsedData.grouped_data.map(company => {
                serial++;
                return [
                serial,
                company.farmerid,
                company.name,
                `तिनाउ-${company.farmerward}`,
                company.transaction_count,
                company.sub_total.toFixed(2),
                company.delivery_charge.toFixed(2),
                company.service_charge.toFixed(2),
                company.total.toFixed(2),
                company.subsidy.toFixed(2),
            ]}),
        ];
    
        // Calculate totals
        const totals = parsedData.grouped_data.reduce((acc, company) => {
            acc.sub_total += parseFloat(company.sub_total);
            acc.delivery_charge += parseFloat(company.delivery_charge);
            acc.service_charge += parseFloat(company.service_charge);
            acc.total += parseFloat(company.total);
            acc.subsidy += parseFloat(company.subsidy);
            return acc;
        }, {
            sub_total: 0,
            delivery_charge: 0,
            service_charge: 0,
            total: 0,
            subsidy: 0,
        });
    
        // Add the total row to the worksheetData
        worksheetData.push([
            '',
            '', // Empty cell for कृषक संकेत
            '', // Empty cell for कृषकको नाम
            '', // ठेगाना (Total)
            'जम्मा', // Empty cell for कुल लेनदेन
            totals.sub_total.toFixed(2),
            totals.delivery_charge.toFixed(2),
            totals.service_charge.toFixed(2),
            totals.total.toFixed(2),
            totals.subsidy.toFixed(2),
        ]);
    
        const worksheet = XLSX.utils.aoa_to_sheet(worksheetData);
        const wscols = [
            {wch: 10},
            {wch: 20}, // कृषक संकेत
            {wch: 20}, // कृषकको नाम
            {wch: 20}, // ठेगाना
            {wch: 20}, // कुल लेनदेन
            {wch: 20}, // कृषि उपजको उप-योगफल
            {wch: 20}, // ढुवानी दस्तुर
            {wch: 20}, // सेवा शुल्क
            {wch: 20}, // जम्मा
            {wch: 20}, // अनुदान
        ];
        worksheet['!cols'] = wscols;
        const workbook = XLSX.utils.book_new();
        XLSX.utils.book_append_sheet(workbook, worksheet, "Report");
    
        XLSX.writeFile(workbook, "ict_report.xlsx");
    }


    createPdfReport(reportData) {
        const parsedData = JSON.parse(reportData);
        pdfMake.fonts = {
            Gargi: {
                normal: 'Gargi.ttf', // Path to the font file
            },
            Roboto: {
                normal: 'Roboto-Regular.ttf',
                bold: 'Roboto-Medium.ttf',
                italics: 'Roboto-Italic.ttf',
                bolditalics: 'Roboto-MediumItalic.ttf'
            },
        };
        const docDefinition = {
            content: [],
            styles: {
                header: {
                    fontSize: 18,
                    alignment: 'center'
                },
                tableHeader: {
                    alignment: 'center'
                },
                tableContent: {
                    alignment: 'center'
                }
            },
            defaultStyle: {
                font: 'Gargi'
            }
        };

        const displayCompany = parsedData.display_company;
const leftData='data:image/jpeg;base64,'

const rightData='data:image/jpeg;base64,'

        const imageSize = 60 + Math.floor(0.3 * 60);

        docDefinition.content.push({
            columns: [
                {
                    image: `${leftData}`,
                    width: 100,
                    alignment: 'left'
                },
                {
                    stack: [
                        { text: `${displayCompany.name} गाउँपालिका`, style: 'header', alignment: 'center' },
                        { text: 'गाउँ कार्यपालिकाको कार्यालय', style: 'header', alignment: 'center' },
                        { text: displayCompany.street, style: 'header', alignment: 'center' },
                        { text: `${displayCompany.province} ,नेपाल`, style: 'header', alignment: 'center', margin: [0, 0, 0, 0] },
                        { text: 'सारांश प्रतिवेदन', style: 'header', alignment: 'center', margin: [0, 10, 0, 10] }
                    ],
                    width: '60%',
                    alignment: 'center'
                },
                {
                    image: `${rightData}`,
                    width: 100,
                    alignment: 'right'
                }
            ]
        });
        const columns = [
            { header: "क्र.सं.", dataKey: 'serial' },
            { header: "कृषक संकेत ", dataKey: 'farmerid' },
            { header: "कृषकको नाम", dataKey: 'name' },
            { header: "ठेगाना", dataKey: 'farmerward' },
            { header: "कारोवार संख्या", dataKey: 'transaction_count' },
            { header: "कृषि उपजको उप-योगफल", dataKey: 'sub_total' },
            { header: "ढुवानी दस्तुर", dataKey: 'delivery_charge' },
            { header: "सेवा शुल्क", dataKey: 'service_charge' },
            { header: "जम्मा", dataKey: 'total' },
            { header: "अनुदान", dataKey: 'subsidy' },
        ];
        
        let serial = 0;
        const rows = parsedData.grouped_data.map(company => {
            serial++;
            return [
                { text: serial, style: 'tableContent' },
                {
                    text: [
                        { text: company.farmerid.slice(0, 2), font: 'Roboto', fontSize: 6 },
                        { text: company.farmerid.slice(2), fontSize: 6 }
                    ],
                    style: 'tableContent',
                },
                { text: company.name, style: 'tableContent' },
                { text: `तिनाउ-${company.farmerward}`, style: 'tableContent' },
                { text: company.transaction_count.toString(), style: 'tableContent' },
                { text: company.sub_total.toFixed(2), style: 'tableContent' },
                { text: company.delivery_charge.toFixed(2), style: 'tableContent' },
                { text: company.service_charge.toFixed(2), style: 'tableContent' },
                { text: company.total.toFixed(2), style: 'tableContent' },
                { text: company.subsidy.toFixed(2), style: 'tableContent' },
            ];
        });
        
        const totals = columns.map(col => {
            if (col.dataKey && col.dataKey !== 'farmerid' && col.dataKey !== 'name' && col.dataKey !== 'farmerward' && col.dataKey !== 'transaction_count') {
                return parsedData.grouped_data.reduce((sum, company) => sum + company[col.dataKey], 0).toFixed(2);
            }
            return "";
        });
        
        const totalRow = [
            { text: 'जम्मा', colSpan: 5, alignment: 'center', style: 'tableHeader', fontSize: 7 }, {}, {}, {}, {},
            { text: totals[5], style: 'tableContent', fontSize: 7 },
            { text: totals[6], style: 'tableContent', fontSize: 7 },
            { text: totals[7], style: 'tableContent', fontSize: 7 },
            { text: totals[8], style: 'tableContent', fontSize: 7 },
            { text: totals[9], style: 'tableContent', fontSize: 7 }
        ];
        
        docDefinition.content.push({
            table: {
                headerRows: 1,
                widths: [
                    'auto', // for "क्र.सं."
                    '*',    // for "कृषक संकेत "
                    '*',    // for "कृषकको नाम"
                    'auto',    // for "ठेगाना"
                    'auto', // for "कारोवार संख्या"
                    '*',    // for "कृषि उपजको उप-योगफल"
                    '*', // for "ढुवानी दस्तुर"
                    '*',    // for "सेवा शुल्क"
                    '*',    // for "जम्मा"
                    '*'     // for "अनुदान"
                ],
                body: [
                    columns.map(col => ({ text: col.header, style: 'tableHeader', fontSize: 8 })),
                    ...rows.map(row => row.map(cell => ({ text: cell.text || cell, fontSize: 7, style: 'tableCell' }))),
                    totalRow
                ],
                layout: {
                    fillColor: function (rowIndex) {
                        return rowIndex % 2 === 0 ? '#F5F5F5' : '#FFFFFF';
                    },
                    paddingLeft: function () { return 10; },
                    paddingRight: function () { return 10; },
                    paddingTop: function () { return 5; },
                    paddingBottom: function () { return 5; },
                    hLineWidth: function () { return 1; },
                    vLineWidth: function () { return 1; },
                    hLineColor: function () { return '#D3D3D3'; },
                    vLineColor: function () { return '#D3D3D3'; }
                }
            },
            styles: {
                tableHeader: {
                    bold: true,
                    fontSize: 8,
                    color: '#333333',
                    fillColor: '#E0E0E0'
                },
                tableCell: {
                    color: '#333333'
                }
            }
        });
        

        pdfMake.createPdf(docDefinition).download("ict_report.pdf");
    }
}

export const ictReportListView = {
    ...listView,
    Controller: IctReportListController,
    buttonTemplate: "owl.IctReportListView.Buttons",
};

registry.category("views").add("ict_report_list_view", ictReportListView);
